    def test_hello_world(self):
        x = np.linspace(-10, 10, 1000)
        records = []
        for i in x:
            records.append({'x': i, 'y': np.sin(i), 't': 'sin'})
            records.append({'x': i, 'y': np.cos(i), 't': 'cos'})
        df = pd.DataFrame(data=records, columns=['x', 'y', 't', 'Reserve'])

        # print([[df['x'][i], df.loc[df['t'] == 'sin', 'y'][i]] for i in range(100)])
        print(df['x'])
        print(df.loc[df['t'] == 'sin', 'y'])
        fig = make_subplots(2, 1)
        y = df.loc[df['t'] == 'sin']
        z = df.loc[df['t'] == 'cos']
        fig.add_trace(go.Scatter(x=y['x'], y=y['y']), row=1, col=1)
        fig.add_trace(go.Scatter(x=z['x'], y=z['y']), row=1, col=1)
        # fig.add_trace(go.Scatter(x=df['x'], y=df['y']), row=2, col=1)
        # fig = px.line(df, x='x', y='y', color='t')
        fig.show()
        self.assertTrue(True)

