    @staticmethod
    def gen_stocks():
        stocks = []
        days = pd.date_range('2022-09-01', periods=10)
        codes = ['sh000001', 'sh000002', 'sz000001', 'sz399001']
        id = 0
        for d in days:
            for c in codes:
                stocks.append({'id': id, 'date': d, 'code': c, 'open': random.gauss(mu=0.0, sigma=0.01),
                               'close': random.gauss(mu=0.0, sigma=0.01), 't': c[:2]})
                id += 1
        return pd.DataFrame(data=stocks)

    def test_stocks(self):
        df = self.gen_stocks()
        print('code and date: %(data)s' % {'data': df[['code', 'date']]})
        indices = df.apply(lambda r: "%(code)s_%(date)s" % {'code': r['code'], 'date': r['date']}, axis=1)
        df.index = indices
        print('indices: %(indices)s' % {'indices': indices})
        np_value = np.where(df['open'] > 0, 1, -1)
        print("np.where result type: %(tt)s, nothing value: %(value)d" % {"tt": type(np_value), 'value': 987})
        df['open'] = np_value
        df.columns = pd.MultiIndex.from_tuples(map(lambda c: ('a', c), df.columns))
        df = df.stack(0).reset_index(1)
        print(df)

    def test_stocks2(self):
        codes = ['sz300996', 'sh688001', 'sz000001', 'sh600030']
        dates = pd.date_range('2022-10-01', periods=10)
        get_market = lambda code: code[:2]
        stocks = [{'id': i * len(dates) + j, 'code': codes[i], 'date': dates[j], 'market': get_market(codes[i]),
                   'price': random.gauss(mu=0, sigma=0.01)}
                  for i in range(len(codes)) for j in range(len(dates))]
        df = pd.DataFrame(data=stocks)
        grouped = df.groupby('code', as_index=True)
        by_date = grouped[['date', 'price']].aggregate(np.min)
        by_price = grouped[['price', 'date']].aggregate(np.min)
        print('type is: %(t)s, grouped is: %(grouped)s' % {'t': type(grouped), 'grouped': by_date})
        print('type is: %(t)s, grouped is: %(grouped)s' % {'t': type(grouped), 'grouped': by_price})

    def test_transform(self):
        stocks = self.gen_stocks()

        tr = stocks.groupby('code')['open'].transform(lambda r: np.percentile(r, 50))
        print(tr.head())
        idx = stocks['open'] == tr
        print("tr is \n%(tr)s" % {'tr': tr})
        print("tr is \n%(tr)s" % {'tr': stocks[idx]})
        self.assertTrue(True)

