    def test_selection(self):
        stocks = self.gen_stocks()
        stocks['delta2'] = stocks.apply(lambda s: s['close'] / s['open'] - 1, axis=1)
        stocks['placeholder'] = ['${data}'] * stocks.shape[0]
        stocks['positive'] = np.where(stocks['close'] > 0, True, False)
        stocks['increment'] = stocks['close'] / stocks['open']
        stocks['index2'] = stocks.apply(lambda r: r.index, axis=1)
        s2 = stocks[stocks['positive']]
        print('s2: \n%s' % s2.head())
        print('new stock: \n%s' % stocks.head())
        t = pd.date_range('2022-09-01', periods=1)
        print("stocks['open']: \n%s" % stocks['open'])
        print("stocks.loc['open']: \n%s" % stocks.loc[10])
        print("stocks['open']: \n%s" % stocks.loc[[20, 10, 5], 'open'])
        close = stocks.sort_values(by='close').groupby('code')['close'].agg([np.min, np.max])
        date = stocks.sort_values(by='date').groupby('code')['date'].agg([np.min, np.max])
        merged = pd.merge(left=close, right=date, on='code')
        merged.columns = pd.MultiIndex.from_tuples([tuple(c.split('_')) for c in merged.columns])
        print("min by code: \n%s" % merged)

        print("min by code: \n%s" % merged.loc[:, tuple(['amin', slice(None)])])
        print("min by code: \n%s" % merged)

        print("specific stock by code: \n%s" % stocks.loc[stocks['code'] == 'sh000001', ['code', 'date', 'close']])

        stocks = stocks.sort_values(by='close').groupby('code').agg(
            close_min=pd.NamedAgg(column='close', aggfunc=lambda x: np.min(x)),
            close_max=pd.NamedAgg(column='close', aggfunc=np.max))
        print("min by code: \n%s" % stocks)

